p.x:
var $bm_rt;
try {
    var ctrl = thisComp.layer(thisLayer(2)('Admin')(2)('A')(2)(1)._name);
    var eff = ctrl(4)('RubberHose 2');
    var a = eff('A');
    var b = eff('B');
    var s = length(a, b);
    var outerRad = mul(Math.sin(0.78539816339), s);
    var straight = Math.max(eff('Straight'), 0.001);
    var sFac = eff('Parent Scale');
    if (sFac === 0) {
        sFac = 0.001;
    }
    var hoseLength = div(eff('Hose Length'), 2);
    var angle = $bm_neg(Math.atan2(sub(b[0], a[0]), sub(b[1], a[1])));
    var bendRad = div(eff('Bend Radius'), 100);
    var realism = div(eff('Realism'), 100);
    var autoFlop = eff('AutoFlop');
    var roundShrink = linear(Math.abs(bendRad), 1, 0.87);
    roundShrink = easeOut(realism, 0, 100, 1, roundShrink);
    var bendDir = div(eff('Bend Direction'), 100);
    bendDir *= autoFlop;
    var rad;
    if (straight < hoseLength) {
        rad = Math.sqrt(sub(mul(hoseLength, hoseLength), mul(straight, straight)));
        rad = linear(realism, sub(hoseLength, div(s, mul(2, Math.abs(sFac)))), rad);
        rad *= bendDir;
        rad *= sFac;
    } else {
        rad = 0;
    }
    try {
        var bias = thisLayer(4)('Center Bias')(1);
        var mid = linear(bias, -99.999, 99.999, b, a);
    } catch (e) {
        var mid = add(b, div(sub(a, b), 2));
    }
    var x = mul(mul(rad, Math.cos(angle)), roundShrink);
    var y = mul(mul(rad, Math.sin(angle)), roundShrink);
    $bm_rt = [
        mid[0] - x,
        mid[1] - y
    ];
} catch (err) {
    $bm_rt = value;
}

